    render() {

        return(
            <React.Fragment>
                <div className="product-list">
                <Title name="Our" title="Products" />
                    <div className="container">
                        <div className="flexible" onClick={() => console.log('You Clicked On Product')}  >
                            
                           
                        </div>
                    </div>
                </div>
            </React.Fragment>
        )
    }

}

export default Productlist;
